package com.acc.regresiontest.com.domains;

import java.util.List;

public class Instrumento {
	
	List<String> instrumentos;
	List<String> origenes;
	List<String> destinos;
	List<String> nombre;
	
public Instrumento() {
	// TODO Auto-generated constructor stub
}

public List<String> getInstrumentos() {
	return instrumentos;
}

public void setInstrumentos(List<String> instrumentos) {
	this.instrumentos = instrumentos;
}

public List<String> getOrigenes() {
	return origenes;
}

public void setOrigenes(List<String> origenes) {
	this.origenes = origenes;
}

public List<String> getDestinos() {
	return destinos;
}

public void setDestinos(List<String> destinos) {
	this.destinos = destinos;
}

public List<String> getNombre() {
	return nombre;
}

public void setNombre(List<String> nombre) {
	this.nombre = nombre;
}


}
